import React, {Component} from 'react';

import '../SubBox/SubBox.css';

import { Card } from 'react-bootstrap';

export class SubBox extends Component {

    render() {
        return(
            <Card style={this.props.style} className="Box2">
            <div className="BoxDiv">
              {this.props.text}
            </div>
          </Card>
        );
    }
}
